        <textColor>#000000</textColor>
        <font>-plain-36</font>
        <URIString>http://vue.tufts.edu/rdf/resource/240c002ec0a8b23900b0ed612d50eaf6</URIString>
        <richText>&lt;html&gt;
  &lt;head color="#ffffff" style="color: #ffffff"&gt;
    &lt;style type="text/css"&gt;
      &lt;!--
        body { font-size: 12; margin-bottom: 0px; margin-right: 0px; font-family: Arial; color: #ffffff; margin-left: 0px; margin-top: 0px }
        ol { font-size: 12; font-family: Arial; margin-left: 30; list-style-position: outside; margin-top: 6; vertical-align: middle }
        p { margin-bottom: 0; margin-right: 0; color: #ffffff; margin-left: 0; margin-top: 0 }
        ul { font-size: 12; font-family: Arial; margin-left: 30; list-style-position: outside; margin-top: 6; vertical-align: middle }
      --&gt;
    &lt;/style&gt;
    
  &lt;/head&gt;
  &lt;body&gt;
    &lt;p color="#ffffff" style="color: #ffffff; text-align: right"&gt;
