    <child ID="6317" label="pav: created by" layerID="1"
        created="1524653267787" x="2935.795" y="18279.344" width="120.0"
        height="44.0" strokeWidth="1.0" autoSized="true" xsi:type="node">
        <notes>An agent primary responsible for making the digital artifact or resource representation.%nl;%nl;This property is distinct from forming the content, which is indicated with pav:contributedBy or its subproperties; pav:authoredBy, which identifies who authored the knowledge expressed by this resource; and pav:curatedBy, which identifies who curated the knowledge into its current form.%nl;%nl;pav:createdBy is more specific than its superproperty dct:creator - which might or might not be interpreted to cover this creator.%nl;%nl;For instance, the author wrote 'this species has bigger wings than normal' in his log book. The curator, going through the log book and identifying important knowledge, formalizes this as 'locus perculus has wingspan &gt; 0.5m'. The creator enters this knowledge as a digital resource in the knowledge system, thus creating the digital artifact (say as JSON, RDF, XML or HTML).%nl;%nl;A different example is a news article. pav:authoredBy indicates the journalist who wrote the article. pav:contributedBy can indicate the artist who added an illustration. pav:curatedBy can indicate the editor who made the article conform to the news paper's style. pav:createdBy can indicate who put the article on the web site.%nl;%nl;The software tool used by the creator to make the digital resource (say Protege, Wordpress or OpenOffice) can be indicated with pav:createdWith.%nl;%nl;The date the digital resource was created can be indicated with pav:createdOn.%nl;%nl;The location the agent was at when creating the digital resource can be made using pav:createdAt.</notes>
        <fillColor>#005E9C</fillColor>
        <strokeColor>#776D6D</strokeColor>
        <textColor>#FFFFFF</textColor>
